import logo from './logo.svg';
import './App.scss';

function App() {
  return (
    <div className="App">
      <header className="header">
        <img src="./img/logo.png" className="header__logo" alt="logo" />
        <div className='header__nav'>
          <h3>Home</h3>
          <h3>Shorts</h3>
          <h3>Gorras</h3>
        </div>
        <div className='header_buttons'>Comprar</div>
      </header>
      <footer className='footer'>
        <h3 className='footer_item'>Todos los derechos reservados</h3>
        <h3>Sitio web creado por Pattacini S.A.</h3>
      </footer>
    </div>
  );
}

export default App;
